import React, { useState } from 'react';
import CoinOptimizerForm from './CoinOptimizerForm';
import CoinOptimizerResult from './CoinOptimizerResult';

const App = () => {
  const [optimizedCoins, setOptimizedCoins] = useState([]);

  return (
    <div>
      <h1>Coin Optimizer App</h1>
      <CoinOptimizerForm setOptimizedCoins={setOptimizedCoins} />
      {optimizedCoins.length > 0 && (
        <CoinOptimizerResult optimizedCoins={optimizedCoins} />
      )}
    </div>
  );
};

export default App;
